class ManageReceiptComponent {
    constructor(api, router, active) {
        this.api = api;
        this.router = router;
        this.active = active;
        this.receipts = { businessName: '', address: '', fee: '', gstNumber: '', termsAndCondition: '' };
    }
    ngOnInit() {
        this.routerId = this.active.snapshot.paramMap.get('id');
        this.getReceipts(this.routerId);
    }
    getReceipts(id) {
        this.api.getReceipt(id).subscribe(data => {
            this.receipts = JSON.parse(JSON.stringify(data));
            console.log(this.receipts.fee);
        });
    }
    edit(id) {
        this.router.navigate([`/pages/institute/branch-config/add-receipt/${this.routerId}`], { queryParams: { recieptId: id, edit: true } });
    }
    delete(id) {
        this.api.deleteReceipt(id).subscribe(() => console.log('delete success'), err => console.error(err));
        // const i = this.receipts.reciepts.findIndex(e => e.id == id)
        // if(i !== -1){
        // this.receipts.splice(i,1);
        // }
    }
    onClick() {
        const routerId = this.active.snapshot.paramMap.get('id');
        this.router.navigate([`/pages/institute/branch-config/add-receipt/${routerId}`]);
    }
}


